process.command:
test -x /bin/cgroups-mount || { stop; exit 0; }
test -d /sys/fs/cgroup || { stop; exit 0; }
/bin/cgroups-mount

[ -f /etc/samba/smb.conf ] || { stop; exit 0; }

install -o root -g root -m 755 -d /var/run/samba
NMBD_DISABLED=`testparm -s --parameter-name='disable netbios' 2>/dev/null || true`

[ "x$NMBD_DISABLED" = xYes ] && { stop; exit 0; }

exit 0

test -x /usr/sbin/sshd || { stop; exit 0; }
test -e /etc/ssh/sshd_not_to_be_run && { stop; exit 0; }
test -c /dev/null || { stop; exit 0; }

mkdir -p -m0755 /var/run/sshd

[ -f /etc/default/lxc ] && . /etc/default/lxc

[ "x$USE_LXC_BRIDGE" = "xtrue" ] || { stop; exit 0; }

cleanup() {
	# dnsmasq failed to start, clean up the bridge
	iptables -t nat -D POSTROUTING -s ${LXC_NETWORK} ! -d ${LXC_NETWORK} -j MASQUERADE || true
	ifconfig ${LXC_BRIDGE} down || true
	brctl delbr ${LXC_BRIDGE} || true
}

if [ -d /sys/class/net/${LXC_BRIDGE} ]; then
	if [ ! -f ${varrun}/network_up ]; then
		# bridge exists, but we didn't start it
		stop;
	fi
	exit 0;
fi

# set up the lxc network
brctl addbr ${LXC_BRIDGE} || { echo "Missing bridge support in kernel"; stop; exit 0; }
echo 1 > /proc/sys/net/ipv4/ip_forward
mkdir -p ${varrun}
ifconfig ${LXC_BRIDGE} ${LXC_ADDR} netmask ${LXC_NETMASK} up
iptables -t nat -A POSTROUTING -s ${LXC_NETWORK} ! -d ${LXC_NETWORK} -j MASQUERADE
dnsmasq -u lxc-dnsmasq --strict-order --bind-interfaces --pid-file=${varrun}/dnsmasq.pid --conf-file=${LXC_DHCP_CONFILE} --listen-address ${LXC_ADDR} --dhcp-range ${LXC_DHCP_RANGE} --dhcp-lease-max=${LXC_DHCP_MAX} --dhcp-no-override --except-interface=lo --interface=${LXC_BRIDGE} --dhcp-leasefile=/var/lib/misc/dnsmasq.${LXC_BRIDGE}.leases --dhcp-authoritative || cleanup
touch ${varrun}/network_up
